[{"location":"index.html#LatexLH-1","page":"LatexLH","title":"LatexLH","text":"","category":"section"},{"location":"index.html#","page":"LatexLH","title":"LatexLH","text":"CurrentModule = LatexLH","category":"page"},{"location":"index.html#Writing-Beamer-Slides-1","page":"LatexLH","title":"Writing Beamer Slides","text":"","category":"section"},{"location":"index.html#","page":"LatexLH","title":"LatexLH","text":"write_figure_slides\nfigure_slide","category":"page"},{"location":"index.html#LatexLH.write_figure_slides","page":"LatexLH","title":"LatexLH.write_figure_slides","text":"write_figure_slides(io, slideV; baseDir)\n\n\nMake a file that contains a set of slides. Each slide is just a title with one figure. Input is a vector of tuples. Each contains a title and a file path for the figure file. Optionally, preprend a common base directory to each path.\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.figure_slide","page":"LatexLH","title":"LatexLH.figure_slide","text":"figure_slide(title, fPath)\n\n\nLatex lines for slide with a single figure.\n\n\n\n\n\n","category":"function"},{"location":"index.html#Writing-Latex-Tables-1","page":"LatexLH","title":"Writing Latex Tables","text":"","category":"section"},{"location":"index.html#","page":"LatexLH","title":"LatexLH","text":"CellColor\nCell\nTable\ncolor_string\ncell_string\nnrows\nadd_row!\nmake_row\nwrite_table","category":"page"},{"location":"index.html#LatexLH.CellColor","page":"LatexLH","title":"LatexLH.CellColor","text":"Defines Latex cell colors. Stores name and intensity of a color.\n\nExample\n\nCellColor(\"blue\", 75)\n\n\n\n\n\n","category":"type"},{"location":"index.html#LatexLH.Cell","page":"LatexLH","title":"LatexLH.Cell","text":"Single or multicolumn cell. Stores text, width, alignment, color.\n\n\n\n\n\n","category":"type"},{"location":"index.html#LatexLH.Table","page":"LatexLH","title":"LatexLH.Table","text":"Table\n\nHolds a Latex table, constructed as a vector of rows.\n\nFlow\n\nConstructor\nMake and add rows (some are just provided by user as strings)\nWrite table\n\n\n\n\n\n","category":"type"},{"location":"index.html#LatexLH.color_string","page":"LatexLH","title":"LatexLH.color_string","text":"color_string(c)\n\n\nReturns a string of the form \"\\cellcolor{blue!75}\".\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.cell_string","page":"LatexLH","title":"LatexLH.cell_string","text":"cell_string(c)\n\n\nReturns a Latex string that makes a cell. Either just the (colored) contents or a multicolumn command.\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.nrows","page":"LatexLH","title":"LatexLH.nrows","text":"nrows(tb)\n\n\nNumber of table rows.\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.add_row!","page":"LatexLH","title":"LatexLH.add_row!","text":"add_row!(tb, rowStr)\n\n\nAdd a row to a table.\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.make_row","page":"LatexLH","title":"LatexLH.make_row","text":"make_row(tb, cellV)\n\n\nMake a row from a vector of cells\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.write_table","page":"LatexLH","title":"LatexLH.write_table","text":"Write table to file.\n\n\n\n\n\n","category":"function"},{"location":"index.html#SymbolTables-1","page":"LatexLH","title":"SymbolTables","text":"","category":"section"},{"location":"index.html#","page":"LatexLH","title":"LatexLH","text":"Intended for looking up names and descriptions of model symbols in code. E.g., for correctly naming objects in tables. Also for writing preamble files with model notation.","category":"page"},{"location":"index.html#","page":"LatexLH","title":"LatexLH","text":"SymbolInfo\nSymbolTable\nadd_symbol!\nhas_symbol\ndescription\nlatex\ngroup","category":"page"},{"location":"index.html#LatexLH.SymbolInfo","page":"LatexLH","title":"LatexLH.SymbolInfo","text":"Information for one symbol: name, latex symbol, description, group.\n\nFor printing: \\ needs to be escaped as \\\\ in latex.\n\n\n\n\n\n","category":"type"},{"location":"index.html#LatexLH.SymbolTable","page":"LatexLH","title":"LatexLH.SymbolTable","text":"SymbolTable()\n\n\nConstructor for empty SymbolTable.\n\n\n\n\n\nSymbolTable(m)\n\n\nConstructor from String array with names, latex symbols, descriptions, groups.\n\nExample\n\nSymbolTable([\"capShare\"  \"\\alpha\"  \"Capital share\"  \"Technology\";\n    \"tfp\"  \"A\"  \"Total factor productivity\"  \"Technology\"]);\n\n\n\n\n\n","category":"type"},{"location":"index.html#LatexLH.add_symbol!","page":"LatexLH","title":"LatexLH.add_symbol!","text":"add_symbol!(s, si; replaceExisting)\n\n\nAdd a new symbol. Overwrite existing if replaceExisting == true.\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.has_symbol","page":"LatexLH","title":"LatexLH.has_symbol","text":"has_symbol(s, name)\n\n\nDoes symbol exist?\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.description","page":"LatexLH","title":"LatexLH.description","text":"description(s, name)\n\n\nReturn description of a symbol.\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.latex","page":"LatexLH","title":"LatexLH.latex","text":"latex(s, name)\n\n\nLatex symbol for a symbol.\n\n\n\n\n\n","category":"function"},{"location":"index.html#LatexLH.group","page":"LatexLH","title":"LatexLH.group","text":"group(s, name)\n\n\nGroup for a symbol.\n\n\n\n\n\n","category":"function"},{"location":"index.html#","page":"LatexLH","title":"LatexLH","text":"","category":"page"}]
